import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  
import './App.css';
import React, { useState } from "react";

// components
import SelectionPage from './views/selectionPage/SelectionPage';
import ConfirmatiomPage from './views/confirmationPage/ConfirmationPage';

function App() {
  // global variables
  const [time, setTime] = useState("");
  const [weather, setWeather] = useState("");

  return (
    <Router>
        <Routes>
        <Route exact path="/" element={<SelectionPage setTime={setTime} setWeather={setWeather} />} />
        <Route exact path="/confirm" element={<ConfirmationPage time={time} weather={weather} />} />
        </Routes>
    </Router>
  );
}

export default App;
